                             if (DialogResult.Yes == MessageBox.Show("确认退出?\r\n如果退出将取消下载。 ", " 退出", MessageBoxButtons.YesNo))
                             {
                                 webFileInfo.StopDownload();
                                 form.Dispose();
                             }
                             else
                             {
                                 webFileInfo.CanDownload = true;
                                 ef.Cancel = true;
                             }
                         };
